import React from 'react';
import Menu from './menu';
import { useHistory } from 'react-router-dom';

function home(props) {

    const history = useHistory();

    return (
        <div>
            <Menu />
            <h1>Home</h1>
            <button onClick={() => history.push('/sobre')}></button>
        </div>
    );
}

export default home;
